sq--src-components-image-js.query:
query usersJohndursoDesktopGatsbyAppPersonalGatsbyjsSrcComponentsImageJs2663961920 {
  placeholderImage: file(relativePath: {eq: "spongebob-patrick-creepy.jpg"}) {
    childImageSharp {
      fluid(maxWidth: 500) {
        ...GatsbyImageSharpFluid
      }
    }
  }
}

fragment GatsbyImageSharpFluid on ImageSharpFluid {
  base64
  aspectRatio
  src
  srcSet
  sizes
}

sq--src-components-seo-js.query:
query DefaultSEOQuery {
  site {
    siteMetadata {
      title
      description
      author
    }
  }
}
